const root=ReactDOM.createRoot(document.getElementById("root"))

function Navbar ()
{
  return(
<nav>

        <h1>Perfumy</h1>

        <ul>
            <li> Home | </li>
            <li>Products | </li>
            <li><a>About |</a> </li>
            <li><a>Contact |</a> </li>
        </ul>
    </nav>
  )

}

root.render("Hello")
